INSERT INTO `checkins` VALUES ('CHK-1767105817189-7z2btsf','USER-1764694649637-g2s5keg',12,2025,6,7,'pas de stress réellement ','il y a une cohésion d\'équipe en  surface pour moi , ca reste professionnel mais ce qui est bien c\'est que tout le monde veut réussir','rien de spécial','pouvoir positionner assez de rdv, mais j\'ai deja anticipé et commencé à prospecter plus de mon coté pour combler les agendas','toujours là maintenant à voir comment évolue l\'entreprise/la logistique et le mode de travail  avec une équipe commerciale qui est censé s\'agrandir. ',NULL,'2025-12-30 14:43:37.191'),('CHK-1769413461543-6tmfi1u','USER-1764692223422-8ww8gg0',1,2026,8,10,'Je me sens bien, un peu stressée du manque de signatures','l\'équipe est au top','J\'ai tenté de ne rien lâcher','des no shows','je continue sur ma dernière vision : 10 000 euros de CA','Landing page : Possibilité de modifier le Prix (pouvoir appliquer une remise), possibilité de mettre un rachat pour lisser sur les 48 mois','2026-01-26 07:44:21.544'),('CHK-1769414874283-nakbp66','USER-1768813643431-h737et5',1,2026,10,10,'rien a dire','bonne ambiance, c\'est un début','lancer les ads','aucunes','avoir tout automatiser avec l\'ia','pour l\'instant rien','2026-01-26 08:07:54.284'),('CHK-1769496818767-ghm1jaq','USER-1768208982783-e2swle6',1,2026,10,10,'Je me sens bien, j\'adore mes missions. C\'est beaucoup d\'organisation mais je ne me sens pas stressée je suis confiante :)','Je me suis super bien intégrée à l\'équipe, l\'ambiance est top','La chose dont je suis le plus fière c\'est d\'avoir redonner une image à Be Hype et avoir trouvé une belle DA pour Digiflow, j\'ai pleins d\'idées pour la suite.','Les difficultés sont plutôt dans le fait de trouver un bon équilibre entre toutes les tâches que j\'ai à faire, prioriser ect','Dans 6 mois j\'aurais pris la bonne \"mécanique\" de travail et je me vois toujours autant créative et force de proposition ! ','On pourrait faire un afterwork quand toute l\'équipe aura été recrutée comme une journée d\'intégration, j\'aimerais aussi mettre en place une réunion dans mon pôle pour faire un brainstorming sur ce que les filles ont vu sur les réseaux en ce moment pour me donner pleins d\'idées ','2026-01-27 06:53:38.768');
