DROP TABLE IF EXISTS `contacts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `contacts` (
  `id` varchar(191) NOT NULL,
  `firstName` varchar(191) NOT NULL,
  `lastName` varchar(191) NOT NULL,
  `email` varchar(191) DEFAULT NULL,
  `phone` varchar(191) DEFAULT NULL,
  `position` varchar(191) DEFAULT NULL,
  `companyId` varchar(191) DEFAULT NULL,
  `siret` varchar(191) DEFAULT NULL,
  `gerant` varchar(191) DEFAULT NULL,
  `status` enum('LEAD','PROSPECT','CLIENT') NOT NULL DEFAULT 'LEAD',
  `qualityScore` int(11) DEFAULT NULL,
  `assignedToId` varchar(191) DEFAULT NULL,
  `address` varchar(191) DEFAULT NULL,
  `city` varchar(191) DEFAULT NULL,
  `postalCode` varchar(191) DEFAULT NULL,
  `country` varchar(191) DEFAULT 'France',
  `source` varchar(191) DEFAULT NULL,
  `createdAt` datetime(3) NOT NULL DEFAULT current_timestamp(3),
  `updatedAt` datetime(3) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `contacts_email_idx` (`email`),
  KEY `contacts_companyId_idx` (`companyId`),
  KEY `contacts_assignedToId_idx` (`assignedToId`),
  KEY `contacts_status_idx` (`status`),
  CONSTRAINT `contacts_assignedToId_fkey` FOREIGN KEY (`assignedToId`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `contacts_companyId_fkey` FOREIGN KEY (`companyId`) REFERENCES `companies` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
