INSERT INTO `daily_quotes` VALUES ('QUOTE-1763841822645-0i5khc2','It isn\'t that they can\'t see the solution. It is that they can\'t see the problem.','Gilbert Chesterton','2025-11-22 00:00:00.000','2025-11-22 20:03:42.646'),('QUOTE-1763889225557-dna0eyn','The greatest weariness comes from work not done.','Eric Hoffer','2025-11-23 00:00:00.000','2025-11-23 09:13:45.558'),('QUOTE-1763982933560-hmrix6j','The greatest weariness comes from work not done.','Eric Hoffer','2025-11-24 00:00:00.000','2025-11-24 11:15:33.561'),('QUOTE-1764056509709-z1tt4wo','Before anything else, preparation is the key to success.','Alexander Graham Bell','2025-11-25 00:00:00.000','2025-11-25 07:41:49.710'),('QUOTE-1764324379019-qkfqqbp','La préparation est la clé primordiale du succès.','Alexander Graham Bell','2025-11-28 00:00:00.000','2025-11-28 10:06:19.020'),('QUOTE-1764576995144-zu777gu','La préparation est la clé primordiale du succès.','Alexander Graham Bell','2025-12-01 00:00:00.000','2025-12-01 08:16:35.145'),('QUOTE-1764692638675-qw4abij','La préparation est la clé primordiale du succès.','Alexander Graham Bell','2025-12-02 00:00:00.000','2025-12-02 16:23:58.679'),('QUOTE-1764795399368-rwca9sc','La préparation est la clé primordiale du succès.','Alexander Graham Bell','2025-12-03 00:00:00.000','2025-12-03 20:56:39.370'),('QUOTE-1764854895444-fj0lnjn','La plus grande lassitude vient du travail non fait.','Eric Hoffer','2025-12-04 00:00:00.000','2025-12-04 13:28:15.445'),('QUOTE-1764942764657-byw880t','La plus grande lassitude vient du travail non fait.','Eric Hoffer','2025-12-05 00:00:00.000','2025-12-05 13:52:44.658'),('QUOTE-1765200996891-riilve6','Les fous rejettent ce qu\'ils voient, pas ce qu\'ils pensent ; les sages rejettent ce qu\'ils pensent, pas ce qu\'ils voient.','Huang Po','2025-12-08 00:00:00.000','2025-12-08 13:36:36.892'),('QUOTE-1765265102252-kymywdj','La plus grande lassitude vient du travail non fait.','Eric Hoffer','2025-12-09 00:00:00.000','2025-12-09 07:25:02.253'),('QUOTE-1765560941448-ioldtzz','La plupart des gens ont atteint leur plus grand succès un pas au-delà de ce qui ressemblait à leur plus grand échec.','Brian Tracy','2025-12-12 00:00:00.000','2025-12-12 17:35:41.449'),('QUOTE-1765783981309-83r8y60','La plupart des gens ont atteint leur plus grand succès un pas au-delà de ce qui ressemblait à leur plus grand échec.','Brian Tracy','2025-12-15 00:00:00.000','2025-12-15 07:33:01.311'),('QUOTE-1765912082158-8kdv074','La plupart des gens ont atteint leur plus grand succès un pas au-delà de ce qui ressemblait à leur plus grand échec.','Brian Tracy','2025-12-16 00:00:00.000','2025-12-16 19:08:02.160'),('QUOTE-1767019860198-w55i13y','Les fous rejettent ce qu\'ils voient, pas ce qu\'ils pensent ; les sages rejettent ce qu\'ils pensent, pas ce qu\'ils voient.','Huang Po','2025-12-29 00:00:00.000','2025-12-29 14:51:00.199'),('QUOTE-1767607118368-kaz11oe','Lorsque le monde vous met à genoux, vous êtes dans la position idéale pour prier.','Rumi','2026-01-05 00:00:00.000','2026-01-05 09:58:38.369'),('QUOTE-1767700676823-6munmix','La plupart des gens ont atteint leur plus grand succès un pas au-delà de ce qui ressemblait à leur plus grand échec.','Brian Tracy','2026-01-06 00:00:00.000','2026-01-06 11:57:56.824'),('QUOTE-1767947235665-o6w1zz9','La plupart des gens ont atteint leur plus grand succès un pas au-delà de ce qui ressemblait à leur plus grand échec.','Brian Tracy','2026-01-09 00:00:00.000','2026-01-09 08:27:15.666');
